import React from 'react';
import ReactDOM from 'react-dom';

const TodoList = () => {

    const items = ['Learn React', 'Build Awesome App'];

    return (
        <ul>
            <li>{items[0]}</li>
            <li>{items[1]}</li>
        </ul>
    );
};

const AppHeader = () =>{
    return <h1>My Todo List</h1>;
};

const SearchPanel = () => {
    return <input placeholder="Search" />;
};

const App = () => {
    return(
        <div>
        <AppHeader />
        <SearchPanel />
        <TodoList />
    </div>
    );
};

ReactDOM.render(<App />, document.querySelector('#root'));
